import http_features
from scripts.const import ports_and_protocols


cwmp_server_list = [s.lower() for s in [
    # wiki
    'libre',
    'openacs',
    'itms',
    'openmdms',
    'freeacs',

    # censys
    'gsoap',
    'tr069',
    'tornado',
    'rompager',
]]


def extract(machine, args):
    res = []
    protocol = 'cwmp'
    ports = [p for c in ports_and_protocols
             if c[0] == protocol
             for p in c[1]]
    for port in sorted(ports, reverse=True):
        res += http_features.get_features(m=machine,
                                          field_prefix='p{}_{}_get'.format(port, protocol),
                                          append_list=True,
                                          server_list=cwmp_server_list)
    return res


